import { __decorate } from "tslib";
import { of, Subject } from "rxjs";
import { Router } from "@angular/router";
import { Injectable } from "@angular/core";
import { HttpClient } from "@angular/common/http";
import { catchError, map } from "rxjs/operators";
import { JwtHelperService } from "@auth0/angular-jwt";
import { UIService } from "../shared/ui.service";
let AuthService = class AuthService {
    // authStateChange$: Subject<void> = new Subject<void>();
    constructor(http, router, jwtHelper, uiService) {
        this.http = http;
        this.router = router;
        this.jwtHelper = jwtHelper;
        this.uiService = uiService;
        this.authChange$ = new Subject();
        this.user = {
            email: "",
            userId: ""
        };
        this.isAuthenticated = false;
    }
    authChangeNotifier(isAuthenticated) {
        this.authChange$.next(isAuthenticated);
    }
    registerUser(authData) {
        // this.user = {
        //     email: authData.email,
        //     userId: Math
        //         .round(Math.random() * 10000)
        //         .toString()
        // }
        // this.authSuccessfully()
        this.uiService.loadingStateNotifier(true);
        return this.http
            .post('api/user/create/', authData)
            .pipe(map((data) => {
            this.uiService.loadingStateNotifier(false);
            if (!data) {
                return false;
            }
            else if (data.token) {
                console.log('%c localStorage.setItem ', 'background: red; color: #fff; padding: 10px;');
                console.log("data");
                console.log(data);
                localStorage.setItem('access', data.token.access);
                localStorage.setItem('refresh', data.token.refresh);
                return true;
            }
            throw {
                error: {
                    detail: data.email[0]
                }
            };
            // const decodedUser = this.jwtHelper
            //     .decodeToken(data.token.access);
            //
            // localStorage.setItem(
            //     'expiration',
            //     decodedUser.exp
            // );
            // this.userInfo.next({
            //     id: decodedUser.user_id,
            //     username: login.username,
            // });
        }), catchError((error) => {
            this.uiService.loadingStateNotifier(false);
            console.log('error');
            console.log(error);
            this.uiService.showSnackBar(error.error.detail, undefined, 3000);
            return of(false);
        }));
    }
    login(authData) {
        // this.user = {
        //     email: authData.email,
        //     userId: Math
        //         .round(Math.random() * 10000)
        //         .toString()
        // }
        if (!(authData && authData.email && authData.password)) {
            console.log("no login!");
            return of(false);
        }
        this.uiService.loadingStateNotifier(true);
        return this.http
            .post('api/user/access/', authData)
            .pipe(map((data) => {
            this.uiService.loadingStateNotifier(false);
            if (!data) {
                return false;
            }
            console.log('%c localStorage.setItem ', 'background: red; color: #fff; padding: 10px;');
            console.log(data.access);
            localStorage.setItem('access', data.access);
            localStorage.setItem('refresh', data.refresh);
            // const decodedUser = this.jwtHelper.decodeToken(data.access);
            // localStorage.setItem('expiration', decodedUser.exp);
            return true;
        }), catchError((error) => {
            this.uiService.loadingStateNotifier(false);
            console.log('error');
            console.log(error);
            this.uiService.showSnackBar(error.error.detail, undefined, 3000);
            return of(false);
        }));
    }
    logout() {
        this.user = {
            email: "",
            userId: ""
        };
        localStorage.removeItem("access");
        localStorage.removeItem("refresh");
        this.authChangeNotifier(false);
        this.router.navigate(['/login']);
    }
    // public getUser(): User {
    //     return {...this.user}
    // }
    // public initAuthListener(): void {
    //
