    //             'background: #fff; color: #000; padding: 10px; border: 1px dashed red;'
    //         );
    //     }
    // }
    getToken(type) {
        return localStorage.getItem(type);
    }
    refreshTokenOrDie() {
        // this.getRefreshToken();
        console.log('%c refreshTokenOrDie 01 ', 'background: red; color: #fff; padding: 10px;');
        console.log("attache");
        // const payload = {
        //     refresh: "test",
        // };
        if (!this.isToken("refresh")) {
            return of(false);
        }
        const payload = {
            refresh: this.getToken('refresh'),
        };
        console.log(payload.refresh);
        return this.http
            .post('/api/user/refresh/', payload)
            .pipe(map((newTokens) => {
            console.log('%c localStorage.setItem authService ', 'background: red; color: #fff; padding: 10px;');
            console.log("newTokens :");
            console.log(newTokens);
            console.log("newTokens.access :");
            console.log(newTokens.access);
            localStorage.setItem('access', newTokens.access);
            // const decodedUser = this.jwtHelper.decodeToken(
            //     newTokens.access
            // );
            // localStorage.setItem('expiration', decodedUser.exp);
            // return of(true);
            return true;
        }), catchError((error) => {
            console.log('error');
            console.log(error);
            return of(false);
            // return false;
        }));
    }
    isBothTokensAlive() {
        console.log('%c isBothTokensAlive ', 'background: green; color: #fff; padding: 10px;');
        if (!this.jwtHelper.isTokenExpired()) {
            return of(true);
        }
        else {
            return this.refreshTokenOrDie();
        }
    }
    isToken(type) {
        let tokenType = localStorage.getItem(type);
        console.log('%c tokenType ', 'background: #fff; color: #000; padding: 10px; border: 1px dashed #000;');
        console.log(tokenType);
        if (tokenType) {
            try {
                let decodedUser = this.jwtHelper.decodeToken(tokenType);
                console.log("decodedUser.token_type === 'tokenType': ", decodedUser.token_type === 'tokenType');
                console.log('decodedUser: ', decodedUser);
                return true;
            }
            catch (error) {
                console.error("The inspected tokenType token doesn't appear to be a JWT.");
                return false;
            }
        }
        else {
            console.log('%c isRefreshToken ', 'background: #422C78; color: #fff; padding: 10px;');
            console.log(tokenType);
            return false;
        }
    }
    authState() {
        console.log('%c isAccessToken ', 'background: green; color: #fff; padding: 0 10px;');
        return this.isToken("access") ? this.isBothTokensAlive() : of(false);
    }
    // public isAuth(): boolean {
    //     return this.isAuthenticated;
    // }
    authSuccessfully() {
        this.authChangeNotifier(true);
        this.router.navigate(['/training']);
    }
};
AuthService.ctorParameters = () => [
    { type: HttpClient },
    { type: Router },
    { type: JwtHelperService },
    { type: UIService }
];
AuthService = __decorate([
    Injectable()
], AuthService);
export { AuthService };
